import Notes from './Notes'

const MusicMakerSheet = ({notes, counter, setCounter}) => {
  return (
    <div className="row flex flex-row border-solid border-2 border-sky-500 w-[80rem] h-[30rem]">
      <div  className="h-9"> 
        <Notes notes={notes} counter={counter} setCounter={setCounter}/>

      </div>
    </div>
  )
}

export default MusicMakerSheet
